import React from 'react';
import '../styles/App.scss';

function Footer() {
  return (
    <footer>
        <p>Designed with Figma and Developed with React by Taylor Dunworth</p>
        <p><a href="https://github.com/taydunworth/taydunworth" target="_blank" rel="noopener noreferrer">Check out my code!</a></p>
    </footer>
  );
}

export default Footer;
